import * as React from 'react';
import * as ReactDOM from 'react-dom';
import Base from './base';
import { Avatar, Container, Content, Details, Header, Name } from './styles';

class Gmail extends React.Component<any, any> {
  constructor(props) {
    super(props);

    this.state = { 
      fromEmail: 'bfyhdgzj@gmail.com',
      toEmails: '',
      textPlain: '',
      subject: '',
    };
  }

  onChange = (name: string, event: any) => {
    this.setState({ [name]: event.target.value });
  };

  renderDetail(label: string, value: string, name: string) {
    return (
      <React.Fragment>
        <p>{label}</p>
        <input 
          type="text" 
          value={value} 
          onChange={this.onChange.bind(this, name)}
        />
      </React.Fragment>
    );
  }

  onSend = () => {
    const { fromEmail, toEmails, textPlain, subject } = this.state;

    const doc = { toEmails, textPlain, fromEmail, subject };
    console.log(doc)
  };

  render() {
    const { toEmails, textPlain, subject } = this.state;

    return (
      <Base type="New message">
        <Header>
          <Avatar>HW</Avatar>
          <Details>
            <Name>Isaac Asimov</Name>
            {this.renderDetail("To", toEmails, 'to')}
            {this.renderDetail("Subject", subject, 'subject')}
          </Details>
        </Header>
        <Container>
          <Content>
            <textarea value={textPlain} onChange={this.onChange.bind(this, 'textPlain')} />
          </Content>
          <button onClick={this.onSend}>Send</button>
        </Container>
      </Base> 
    );
  }
}

ReactDOM.render(<Gmail />, document.getElementById("app"));
